import React, {useRef} from 'react';
import TextField from '@mui/material/TextField';
import Button from '@material-ui/core/Button';
import '../css/Home.css';
import appstore from '../images/appstore.svg';
import google from '../images/google.svg';

function Home() {
  const nameRef = useRef('name');
  const roomRef = useRef('roomCode');

  const setName = () => {
    return console.log(nameRef.current.value)
  }

  const setRoom = () => {
    return console.log(roomRef.current.value)
  }

  return (
    <section className ="section">
      <div className ="Left">
        <div className ="containerLeft">
          <div className="textField">
            <TextField id="outlined-basic" label="Name" variant="outlined" inputRef ={nameRef} onChange={setName}/>
          </div>
          <TextField id="outlined-basic" label="Room Code" variant="outlined" inputRef = {roomRef} onChange={setRoom}/>
        </div>
      </div>

      <div className = "Middle">
        <Button className = "StartGame" style={{color:'white',backgroundColor:'#00c500'}} onClick={()=>{console.log('I WORK')}}> START GAME </Button>
      </div>

      <div className ="Right">
        <div className ="containerRight">
          <h2 className="h2"> Play in 3D </h2>
          <img src={appstore} alt="Appstore" className="image" />

          <img src={google} alt="Google Store" className="image2" />
        </div>
      </div>
    </section>
  );
}

export default Home;
